import { MDXProvider } from '@mdx-js/react'
import Image from 'next/image'
import { Heading, Text} from '../../components/blogposts'

const components = {
  img: Image,
  h1: Heading.H1,
  h2: Heading.H2,
  h6: Heading.H6,
  p: Text,
}

export default function Layout(props) {
  return (
    <MDXProvider components={components}>
      <main {...props} />
    </MDXProvider>
  )
}
